// src/Navbar.js
import React from "react";
import hero from "./assets/hero.svg";
import "./hero.css";

function HeroSection() {
  return (
    <div className="hero">
      <div className="something">
        <img src={hero} />
      </div>
      <div>
        <div className="curve"></div>
        <div className="curve1"></div>
        <div className="curve2"></div>
      </div>
    </div>
  );
}

export default HeroSection;
